func main() {
	//GetUnsafeData()
	inputReader := bufio.NewReader(os.Stdin)
	for {
		// 以\n为分隔符读取字符串
		domainInput, err := inputReader.ReadString('\n')
		// 去空格
		domainInput = strings.Replace(domainInput, " ", "", -1)
		// 去除换行符
		domainInput = strings.Replace(domainInput, "\n", "", -1)
		GetUnsafeData(domainInput)
		if err == io.EOF {
			log.Println("=================== 获取子域名完毕 ==============================")
			break
		} else if err != nil {
			log.Printf("read err: %v\n", err)
			break
		}
	}
}

func GetUnsafeData(domainInput string) {
	// 简式声明一个http.Client空结构体指针对象
	client := &http.Client{}
	// 使用http.NewRequest构建http Request请求
	request, err := http.NewRequest("GET", "https://unsafe.sh/domain/result?domain=" + domainInput, nil)
	if err != nil {
		fmt.Println(err)
	}
	// 设置request的Header，具体可参考http协议
	request.Header.Set("Host", "unsafe.sh")
	request.Header.Set("Connection", "close")
	request.Header.Set("Accept", "*/*")
	request.Header.Set("User-Agent", "Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/87.0.4280.66 Safari/537.36")
	request.Header.Set("X-Requested-With", "XMLHttpRequest")
	//request.Header.Set("Sec-Fetch-Site", "same-origin")
	//request.Header.Set("Sec-Fetch-Mode", "cors")
	//request.Header.Set("Sec-Fetch-Dest", "empty")
	//request.Header.Set("Referer", "https,//unsafe.sh/domain/index")
	//request.Header.Set("Accept-Encoding", "gzip, deflate")
	request.Header.Set("Accept-Language", "zh-CN,zh;q=0.9")
	//request.Header.Set("Cookie", "beegosessionID=fdcf84e48ebbb87ed9d2c479319df55a; __tins__20302257=%7B%22sid%22%3A%201662823303958%2C%20%22vd%22%3A%201%2C%20%22expires%22%3A%201662825103958%7D; __51cke__=; __51laig__=1; Hm_lvt_d7825adf12943cb1a605f0ede6c31ce8=1662823305; Hm_lpvt_d7825adf12943cb1a605f0ede6c31ce8=1662823305; __gads=ID=770de3ac978aa6b8-22d439315ad60072,T=1662823306,RT=1662823306,S=ALNI_MZnx-AJjkQvMmjKugvzpxSrgAxnzA; __gpi=UID=000009ac52059a3d,T=1662823306,RT=1662823306,S=ALNI_MZHGc-pMf69lm015PQzWJF0Rp4H9Q")
	// 使用http.Client 来发送request，这里使用了Do方法。
	response, err := client.Do(request)
	if err != nil {
		fmt.Println(err)
		return
	}
	// 程序结束时关闭response.Body响应流
	defer response.Body.Close()
	// 接收到的http Response 状态值
	fmt.Println(domainInput + " | " + strconv.Itoa(response.StatusCode))
	if response.StatusCode == 200 { // 200意味成功得到http Server返回的http Response信息
		body, _ := ioutil.ReadAll(response.Body)
		DealJson(domainInput ,string(body))
	}
}

